webpackJsonp([53],{3:function(e,n,t){e.exports=t(2)(155)},355:function(e,n,t){"use strict";function a(e){return e&&e.__esModule?e:{"default":e}}Object.defineProperty(n,"__esModule",{value:!0});var r=t(1),o=a(r),s=t(3),i=a(s),u=t(538),l=a(u),c=function(){return o["default"].createElement("div",null,o["default"].createElement(i["default"],{text:l["default"]}))};n["default"]=c},538:function(e,n){e.exports="# 新建一个页面\n\n之前的[文件结构介绍](./docs.html#/column/projectIntro)中，已经有了一个项目的基本文件结构。在有新业务需求的时，\b我们来新建一个页面。\n\n### Page\n\n将目录切换到src/components/pages，新建一个文件夹Detail，在Detail中新建一个页面，需要继承Page类，如下：\n\n```javascript\nimport {Page} from 'chanjet-navigator';\n\nexport defalut class NewPage extends Page {\n  \ttitle = 'new page';\n  \trenderContent() {\n  \t\treturn (\n        \t<div> 一个新页面 </div>\n        );\n\t}\n}\n```\n\n\n\n通过chanjet-gzq-h5生成的项目中，您可以在src/components文件夹中，看到一个BasePage.js文件，所以上面的代码也可以改成：\n\n```javascript\nimport BasePage from '../../BasePage';\n\nexport defalut class NewPage extends Page {\n  \ttitle = 'new page';\n  \trenderContent() {\n  \t\treturn (\n        \t<div> 一个新页面 </div>\n        );\n\t}\n}\n\n```\n\n想了解到Page更多的内容，请前往[文档-Page](./docs.html#/navigator/page)\n\n\n\n### 页面跳转\n\n有了新的页面，要将多个页面串联起来。下面就来介绍下，如何从首页或其他页面，跳转到当前页面；在项目中src文件夹下，可以看到app-routes.js，这里就是注册页面路由的地方。下面代码中，我们将新页面放到routes中：\n\n```javascript\nexport const routes = {\n    home: '/home',\n    list: '/list',\n    detail: '/detail' //注：在这里写上你的新页面，暂称之为detail\n}\nconst routeMap = {\n    // require 为静态编译， 重复部分不能省略\n    [routes.list]: (cb) => {require.ensure([], (require) => {cb(require('./components/pages/List/Page').default)})},\n    [routes.home]: (cb) => {require.ensure([], (require) => {cb(require('./components/pages/Home/Page').default)})},\n \t[routes.detail]: (cb) => {require.ensure([], (require) => \t\t{cb(require('./components/pages/Detail/Page').default)})}, //注：这里写上你的新页面的路径\n}\n```\n\n\n\n页面路由，设置完成后，再来看如何在其他页面中跳转过去。\n\n```javascript\nthis.navigatorController.push('/detail');\n```\n\n通过navigator的push方法，可切换到要显示的页。关于navigator中的更多用法，请前往[文档-navigator](./docs.html#/navigator/navigationcontroller)。\n\n\n\n"}});